import React from "react";

function Footer() {
  return (
    <nav className="flex border-2 border-purple-500 m-2 space-x-2">
      <h4 className="flex-auto basis-1/5 border-2 border-orange-500">Home</h4>
      <h4 className="flex-auto border-2 border-orange-500">Search</h4>
      <h4 className="flex-auto border-2 border-orange-500">Box</h4>
      <h4 className="flex-auto basis-1/5 border-2 border-orange-500">Login</h4>
    </nav>
  );
}

export default Footer;
